import logo from './logo.svg';
import './App.css';
import ShoppingList from './compoent/shoplist';


function App(props) {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <ShoppingList name={["DDD","aaa"]} age={45} ></ShoppingList>
      </header>
    </div>
  );
}

export default App;
